import React, { useRef, useState, useEffect } from 'react';
import Papa from "papaparse";

function ImageCarousel() {
    const [data, setData] = useState([]);

    useEffect(() => {
        Papa.parse('https://docs.google.com/spreadsheets/d/e/2PACX-1vQfQhVWmUwk7T0MC-TejeuFDg-dkeRyLkZW-CXyG8dmb3BkeXkuTQwsgp-OJIE7Cp7qc4WoPOtlgWyg/pub?gid=0&single=true&output=csv', {
            header: true,
            download: true,
            dynamicTyping: true,
            complete: (results) => {
                setData(results.data);
            }
        });
    }, []);




    return (
        <div className="image-carousel-container">

            {data.length ?
                <div className="recent-update-section">
                    <div className="row">
                        {data.map((item, index) => {
                            return (
                                <div className='col-md-4'>
                  <div className="card-item" data-aos="fade-up">
                    <div className="card-item-img">
                      <img  src={item.ImageLink} alt='item'/>
                    </div>
                    <div className="card-item-content">
                    <a href={item.ArticleLink} target="_blank" rel="noreferrer"><p>{item.EventName}</p></a>

                    </div>

                  </div>

                </div>


                                // <div className="col-md-4">
                                //     <div className='recent-update-item'>
                                //         <div className="recent-update-item-img">
                                //             <a href={item.ArticleLink} target="_blank" rel="noreferrer">
                                //                 <img
                                //                     src={item.ImageLink}
                                //                     alt="Recent Update"
                                //                 />
                                //             </a>

                                //         </div>

                                //         <div className="image-item-caption">
                                //             <p>{item.Title}</p>
                                //         </div>
                                //     </div>

                                // </div>



                            )
                        })}
                    </div>



                </div>
                : <p className='Loading-tag'>Loading...</p>}
        </div>
    );
}

export default ImageCarousel;
